import React, { Component } from 'react'
import me from './images/sitProfessional.png'
import google from './images/google.jpg'
import './App.css';

class Portrait extends Component {
    render() {
        return (
            <img className="grayscale"

                src={google}
                alt="me"
            />
        )
    }
}

export default Portrait
